# project = leetcode719-第k小的数对距离
from collections import defaultdict
from queue import PriorityQueue
from typing import List


class Solution:
    # 二分+滑动窗口
    def smallestDistancePair(self, nums: List[int], k: int) -> int:
        l,r=0,1e6
        nums.sort()
        def count(nums,mid):
            ans,j=0,1
            n=len(nums)
            for i in range(n):
                while j<n and nums[j]-nums[i]<=mid: j+=1
                ans+=(j-i-1)
            return ans

        while l < r:
            mid=l+(int(r-l)>>1)
            if count(nums,mid)>=k:r=mid
            else: l=mid+1
        return l






solution=Solution()
